The rituals and traditions of the Greek Orthodox Church and the familiar surroundings of our small village were of tremendous comfort in this difficult time and I am glad we respected his wish to be buried in the village he was born and raised in, despite how stressful it was to fly him out to Greece. He joined my Yiayia in a place of light, in a place of green pasture, in a place of refreshment, from where pain, sorrow, and sighing have fled away, 21 long years after she took her final journey and I am further comforted in knowing they have been reunited.

Today marks the fortieth day after his death and is, according to some/many, the day the soul finds its place in the afterlife. For others, it is simply custom to remember our deceased 40 days after death in honour of Christ‚Äôs 40 days on earth after Resurrection. Whatever the reason might be, today as all days, we remember my Pappou and his life well-lived. May his memory be eternal, worthy of blessedness and everlasting memory.

